import React from 'react'

export function DropList(props: any) {
    return (
        <div>
            <DropListTitle value={prop} />
            <DropListBody
                one={'4/4'}
                two={'4/8'}
                three={'6/6'}
                four={'6/12'}
                five={'8/16'} />
        </div>
    )
}

function DropListTitle(props: any) {
    return (
        <><h3>{props.value}</h3></>
    )
}

function DropListBody(props: any) {
    return (
        <ul>
            <li><i>{props.one}</i></li>
            <li><i>{props.two}</i></li>
            <li><i>{props.three}</i></li>
            <li><i>{props.four}</i></li>
            <li><i>{props.five}</i></li>
        </ul>
    )
}
